let width=window.innerWidth/100,height=window.innerHeight/100
export const responsive={
    from:function(){
        let style={
            top:`${30*height}px`,
            position:'relative',
            width:`${10*width}px`,
            height:`${5*height}px`,
            left:`${35*width}px`,
            display:'flex'
        }
        return style
    },
   input:function(){
    let style={
        height:`${5*height}px`,
        width:`${100*width}px`,
        border:`${0.1*height}px solid black`,
        margin:`${10*height}px`
    }
    return style
   }
}
